import router from "@/router";

/*eslint-disable */
function recarga() {
  debugger;
  setTimeout(function () {
    window.location.reload();
  }, 880);
}

function toHome() {
  debugger;
  setTimeout(function () {
    this.$router.push("/");
  }, 880);
}

module.exports = { recarga, toHome };
